import React, { useState } from 'react';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './AgentListings.css';

const AgentListings = () => {
  const [activeTab, setActiveTab] = useState('listings');
  const [searchQuery, setSearchQuery] = useState('');
  const [currentPage, setCurrentPage] = useState(1);

  // Mock data for property listings
  const listingsData = [
    {
      id: 1,
      image: 'https://images.unsplash.com/photo-1486406146926-c627a92ad1ab?w=60&h=60&fit=crop',
      address: '123 Elm Street, Anytown, CA',
      propertyType: 'Office',
      size: '15,000',
      askingPrice: '$2,500,000',
      status: 'Active'
    },
    {
      id: 2,
      image: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=60&h=60&fit=crop',
      address: '456 Industrial Blvd, Anytown, CA',
      propertyType: 'Warehouse',
      size: '30,000',
      askingPrice: '$1,800,000',
      status: 'Pending'
    },
    {
      id: 3,
      image: 'https://images.unsplash.com/photo-1441986300917-64674bd600d8?w=60&h=60&fit=crop',
      address: '789 Retail Ave, Anytown, CA',
      propertyType: 'Retail',
      size: '5,000',
      askingPrice: '$1,200,000',
      status: 'Active'
    },
    {
      id: 4,
      image: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=60&h=60&fit=crop',
      address: '101 Development Dr, Anytown, CA',
      propertyType: 'Land',
      size: '2 acres',
      askingPrice: '$800,000',
      status: 'Active'
    },
    {
      id: 5,
      image: 'https://images.unsplash.com/photo-1486406146926-c627a92ad1ab?w=60&h=60&fit=crop',
      address: '222 Oak Street, Anytown, CA',
      propertyType: 'Mixed-Use',
      size: '20,000',
      askingPrice: '$3,500,000',
      status: 'Sold'
    },
    {
      id: 6,
      image: 'https://images.unsplash.com/photo-1486406146926-c627a92ad1ab?w=60&h=60&fit=crop',
      address: '333 Main Street, Anytown, CA',
      propertyType: 'Office',
      size: '10,000',
      askingPrice: '$1,900,000',
      status: 'Active'
    },
    {
      id: 7,
      image: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=60&h=60&fit=crop',
      address: '555 Industrial Park Rd, Anytown, CA',
      propertyType: 'Warehouse',
      size: '25,000',
      askingPrice: '$1,500,000',
      status: 'Active'
    },
    {
      id: 8,
      image: 'https://images.unsplash.com/photo-1441986300917-64674bd600d8?w=60&h=60&fit=crop',
      address: '666 Commerce Blvd, Anytown, CA',
      propertyType: 'Retail',
      size: '7,500',
      askingPrice: '$1,600,000',
      status: 'Active'
    }
  ];

  // Filter listings based on search query
  const filteredListings = listingsData.filter(listing =>
    listing.address.toLowerCase().includes(searchQuery.toLowerCase()) ||
    listing.propertyType.toLowerCase().includes(searchQuery.toLowerCase()) ||
    listing.askingPrice.toLowerCase().includes(searchQuery.toLowerCase())
  );

  const handleSearch = (e) => {
    setSearchQuery(e.target.value);
    setCurrentPage(1); // Reset to first page when searching
  };

  const handleEdit = (listingId) => {
    // Navigate to the edit listing page
    window.location.href = `/dashboard/edit-listing/${listingId}`;
  };

  const handleRemove = (listingId) => {
    console.log('Remove listing:', listingId);
    // Add remove functionality here
  };

  const handleAddNewListing = () => {
    // Navigate to the add listing page
    window.location.href = '/dashboard/add-listing';
  };

  const getStatusBadgeClass = (status) => {
    switch (status.toLowerCase()) {
      case 'active':
        return 'status-badge active';
      case 'pending':
        return 'status-badge pending';
      case 'sold':
        return 'status-badge sold';
      default:
        return 'status-badge';
    }
  };

  return (
    <div className="agent-listings">
      <Header />
      <div className="dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">Manage Listings</h1>
          </div>
          
          <div className="listings-content">
            {/* Search Bar */}
            <div className="search-section">
              <div className="search-container">
                <span className="search-icon">üîç</span>
                <input
                  type="text"
                  className="search-input"
                  placeholder="Search by address, property type, or keywords"
                  value={searchQuery}
                  onChange={handleSearch}
                />
              </div>
            </div>

            {/* Listings Table */}
            <div className="listings-table-container">
              <table className="listings-table">
                <thead>
                  <tr>
                    <th>Image</th>
                    <th>Address</th>
                    <th>Property Type</th>
                    <th>Size (sq ft)</th>
                    <th>Asking Price/Rent</th>
                    <th>Status</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredListings.map((listing) => (
                    <tr key={listing.id}>
                      <td className="image-cell">
                        <img 
                          src={listing.image} 
                          alt={listing.address}
                          className="property-thumbnail"
                        />
                      </td>
                      <td className="address-cell">{listing.address}</td>
                      <td className="property-type-cell">{listing.propertyType}</td>
                      <td className="size-cell">{listing.size}</td>
                      <td className="price-cell">{listing.askingPrice}</td>
                                             <td className="status-cell">
                         <div style={{textAlign: 'center'}}>
                           <span 
                             style={{
                               display: 'inline-block',
                               padding: '0.375rem 0.75rem',
                               borderRadius: '20px',
                               fontSize: '0.75rem',
                               fontWeight: '600',
                               color: 'white',
                               textTransform: 'uppercase',
                               letterSpacing: '0.05em',
                               backgroundColor: listing.status === 'Active' ? '#3b82f6' : 
                                              listing.status === 'Pending' ? '#f59e0b' : 
                                              listing.status === 'Sold' ? '#6b7280' : '#d1d5db',
                               border: '1px solid transparent',
                               minWidth: '80px'
                             }}
                           >
                             {listing.status}
                           </span>
                           
                         </div>
                       </td>
                      <td className="actions-cell">
                        <button 
                          className="action-link edit-link"
                          onClick={() => handleEdit(listing.id)}
                        >
                          Edit
                        </button>
                        <span className="action-separator">|</span>
                        <button 
                          className="action-link remove-link"
                          onClick={() => handleRemove(listing.id)}
                        >
                          Remove
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>

            {/* Pagination */}
            <div className="pagination-container">
              <div className="pagination">
                <button className="pagination-arrow">‚Üê</button>
                <button className="pagination-page active">1</button>
                <button className="pagination-page">2</button>
                <button className="pagination-page">3</button>
                <button className="pagination-page">10</button>
                <span className="pagination-ellipsis">...</span>
                <button className="pagination-arrow">‚Üí</button>
              </div>
            </div>

            {/* Add New Listing Button */}
            <div className="add-listing-section">
              <button className="add-new-listing-button" onClick={handleAddNewListing}>
                Add New Listing
              </button>
            </div>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default AgentListings;
